import './Projects.css';
import Page from "../../components/Page/Page.js";
import Card from "../../components/Card/Card.js";

import Lehigh_logo from "../../images/Lehigh-logo.png";
import data_sci_fi_proj from "../../attachments/analysis_report.html";

function Projects(props) {
  return (
    <Page id="Projects" header="Projects">
      <Card 
        image={Lehigh_logo}
        alt='Lehigh logo'
        title='Data Science for Finance Class Project'
        subtitle='February 2022 - May 2022'
        description={`In my last semester of undergraduate study, I took a course called "Data Science 
        for Finance," which applies data science concepts in analyzing financial data. For the course's 
        midterm project, we attempted to answer the question, "what types of firms were hurt more or 
        less by covid?"`}
      >
        <p>
          In my last semester of undergraduate study, I took a course called "Data Science 
          for Finance," which applies data science concepts in analyzing financial data. For the course's 
          midterm project, we attempted to answer the question, "what types of firms were hurt more or 
          less by covid?" The work for my project is below.
        </p>
        <iframe src="attachments/analysis_report.html" width="90%" height="600px"></iframe>
      </Card>
      <Card 
        image={Lehigh_logo}
        alt='Lehigh logo'
        title='IBEer, Lehigh University'
        subtitle='February 2021 - May 2021'
        description="My name is Ryan Schmid, a computer science Master's student at Lehigh Univeristy. 
        Before my time as a graduate student, I completed two Bachelor's degrees at Lehigh, 
        one in Computer Engineering and the other in Inegrated Business and Engineering (IBE) with a major in Finance 
        as part of the university's IBE Honors Program."
      />
    </Page>
  );
}

export default Projects;
